import 'bootstrap/dist/css/bootstrap.min.css';
import Login from './Components/User/login';
import { Container } from 'react-bootstrap';


function App() {
  return (
    <div id="body">
      <Container>
          <Routes>
            <Route path="/login" component={Login} />
          </Routes>
      </Container>
    </div>

  )
}

export default App;
